const Product = () => {
    const [item, setItem] = useState('')
   
    useEffect(()=>{
       const getProduct=async()=>{
           const product=await fetch("https://fakestoreapi.com/products")
           const result=product.json()
           setItem(result)
          

       }
       getProduct()
    },[])
   

  return (
    <>
